import React from 'react'
import AppBar from "../components/AppBar";


const HomePage = () => {


    return(
        <>
        <AppBar />
        <div className="text-center">
            <h1 className="display-4">Welcome to the library!</h1>
        </div>
        </>

    )
}

export default HomePage
